import React from 'react';
import Navbar from './UI/navbar.jsx';
import Header from './UI/header.jsx';
import '../styles/layout.sass';

const Layout = ({ children }) => {
    return (
        <main className="content">
            <Header />
            <Navbar />
            {children}
        </main>
    );
};

export default Layout;
